const InventoryManage = () => {
  const inventoryData = [
    {
      name: "1幢",
      id: 1,
    },
    {
      name: "2幢",
      id: 2,
    },
    {
      name: "3幢",
      id: 3,
    },
    {
      name: "4幢",
      id: 4,
    },
    {
      name: "5幢",
      id: 5,
    },
  ];
  return (
    <>
      <div>库存管理</div>
      <div>
        {inventoryData.map((item) => {
          return <div key={item.id}>{item.name}</div>;
        })}
      </div>
    </>
  );
};
export default InventoryManage;
